// SPDX-License-Identifier: Unlicensed
pragma solidity ^0.8.3;
import "@openzeppelin/contracts/access/Ownable.sol";
import "./libraries/FixedPoint.sol"; 

contract GameWorld is Ownable {

    enum EntityType { 
        TILE,       // q1: TileType     q2: Modifier
        WALL, 
        ARMY, 
        FARM        // q1: BlockNumber  q2: FarmValue
        }

    struct Entity {
        uint32 id;
        EntityType entityType;
        uint64 qualifier1_32x32; 
        uint64 qualifier2_32x32; 
        uint16 locx;
        uint16 locy;
    }

    mapping (uint32 => Entity) public allEntities;
    uint16 public map_width;
    uint16 public map_height;

    mapping (uint32 => address) entityToOwner; 
    mapping (uint32 => uint64) tokensBurntAtBlock; // Token capped out at 2 ** 64 
    mapping (uint32 => uint64) landValueAddedAtBlock;

    // Fixed point float numbers , with range [0, 2*8] and resolution of 1/2*8
    uint64 public yieldMin_32x32; 
    uint64 public yieldRange_32x32; 
    uint64 public globalLandValue_32x32;

    constructor(uint64 _yieldMin_32x32, uint64 _yieldRange_32x32) {
        yieldMin_32x32 = _yieldMin_32x32;
        yieldRange_32x32 = _yieldRange_32x32; 
        globalLandValue_32x32 = 0;
    }

    modifier onlyOwnerOf(uint32 _entityId, address owner) {
        require(entityToOwner[_entityId] == owner);
        _;
    }

    modifier isEmpty(uint16 _locx, uint16 _locy, uint8 layer) {
        require(entityToOwner[_locx  + _locy * map_width + layer * map_width * map_height] == address(0));
        _; 
    }

    function _randMod(uint _seed, uint _nonce, uint _mod) internal pure returns(uint) {
        return uint(keccak256(abi.encodePacked(_seed, _nonce))) % _mod; 
    }

    // This function can only be called by whoever deployed the contract 
    function populateLand(uint16 _width, uint16 _height, uint _seed) onlyOwner public {
        require(allEntities[0].locx == 0, "Non-empty world");

        map_width = _width;
        map_height = _height; 

        // Declare a local nonce so that the same seed will generate the same map 
        uint nonce = 0;

        for (uint16 y = 0; y < _width; y++) {
            for (uint16 x = 0; x < _height; x++) {
                uint32 index = x + y * map_width;
                // Currently only generates arable lands 
                Entity memory newLand = Entity(uint32(index), EntityType.TILE, 0, uint64(FixedPoint.add(yieldMin_32x32, _randMod(_seed, nonce++, yieldRange_32x32), 32, 32, 32)), x, y);
                allEntities[index] = newLand; 
                entityToOwner[index] = address(0); // wilderness

            }
        }
    }

    // Returns total farm yield at current block number, in the UQ144x112 format. Assumes supply of tokens do not exceed 2**144 - 1 
    function yieldValue(uint16 _locx, uint16 _locy) view public returns(uint) {
        uint32 index = _locx + _locy * map_width + map_height * map_width; 
        Entity storage thisFarm = allEntities[index];
        require(thisFarm.entityType == EntityType.FARM);
        uint landValueAtBlock_224x32 = globalLandValue_32x32; 
        uint cumulativeYield_224x32 = 0; 
        for (uint32 i = uint32(block.number); i > allEntities[index].qualifier1_32x32; i--) {
            cumulativeYield_224x32 = FixedPoint.add(cumulativeYield_224x32, 
            FixedPoint.multiply(FixedPoint.divide(thisFarm.qualifier2_32x32, landValueAtBlock_224x32, 32, 32, 224, 32), 
            tokensBurntAtBlock[i], 32, 0, 224, 32), 
            0, 32, 224); 
            landValueAtBlock_224x32 = FixedPoint.sub(landValueAtBlock_224x32,landValueAddedAtBlock[i], 32, 32, 224); 
        }
        return cumulativeYield_224x32;
    }

    // Requires implementation of ERC20 
    function buildFarm(uint16 _locx, uint16 _locy, uint32 tokenStaked) public isEmpty(_locx, _locy, 1) {
        uint32 index = _locx + _locy * map_width + map_height * map_width;
        uint32 blockNumber = uint32(block.number);
        // Check if message sender approved for token to be staked in the smart contract  
        uint64 landValue_32x32 = uint64(FixedPoint.sqrt(uint64(tokenStaked) << 32, 32, 32));
        allEntities[index] = Entity(index, EntityType.FARM, blockNumber, landValue_32x32, _locx, _locy);
        landValueAddedAtBlock[blockNumber] = uint64(FixedPoint.add(landValueAddedAtBlock[blockNumber], landValue_32x32, 32, 32, 32));
        globalLandValue_32x32 = uint64(FixedPoint.add(globalLandValue_32x32, landValue_32x32, 32, 32, 32)); 
    }

    // Requires implementation of ERC20 
    function buildWall(uint16 _locx, uint16 _locy, uint32 tokenStaked) public isEmpty(_locx, _locy, 1) {
        uint32 index = _locx + _locy * map_width + map_height * map_width;
        uint32 blockNumber = uint32(block.number);
        // Check if message sender approved for token to be staked in the smart contract  
        uint64 wallFortification_32x32 = uint64(tokenStaked) << 32;
        allEntities[index] = Entity(index, EntityType.WALL, blockNumber, wallFortification_32x32, _locx, _locy);
        tokensBurntAtBlock[blockNumber] = tokensBurntAtBlock[blockNumber] + wallFortification_32x32;
    }

}
